import{Y as t}from"./chunk-JEN6AWE5.js";var l=class r{constructor(){}subcategoriesObject=[{table:!0,id:1,title:"Aliaje de lipit cu continut Argint fara Cadmiu",category:"Aliaje",imageURL:"image1.jpg",descriere:"Aliaje de lipit cu con\u021Binut de argint pentru aplica\u021Bii generale. Acestea sunt \xEEmp\u0103r\u021Bite \xEEn dou\u0103 categorii: aliaje cu staniu \u0219i aliaje f\u0103r\u0103 staniu."},{table:!0,id:2,title:"Aliaje de lipit cu continut Argint si Cadmiu",category:"Aliaje",imageURL:"image2.jpg",descriere:"Aliaje de lipit cu con\u021Binut de argint pentru aplica\u021Bii generale. Av\xE2nd \xEEn vedere c\u0103 oxidul de cadmiu este toxic, este necesar s\u0103 se prevad\u0103 m\u0103suri de securitate a muncii, adecvate, la locul de munc\u0103 (echipamente m\u0103\u0219ti de protec\u021Bie). Este interzis\u0103 folosirea acestor aliaje \xEEn aplica\u021Bii care implic\u0103 producerea de utilaje \u0219i echipamente alimentare, ele pot aduce atingere, \xEEn general, s\u0103n\u0103t\u0103\u021Bii umane. World Industry recomand\u0103 evitarea utiliz\u0103rii de aliaje care con\u021Bin cadmiu, atunci c\xE2nd este posibil utilizarea substituen\u021Bilor f\u0103r\u0103 cadmiu.",warning:"Toate aceste aliaje contin cadmiu si pot provoca probleme de sanatate daca nu se folosesc echipamente  pentru protectia muncii"},{table:!0,id:3,title:"Aliaje de lipit cu continut de Cupru si Zinc (Alame) Sudura si lipire (autogen)",category:"Aliaje",imageURL:"image3.jpg",descriere:"Acest grup include patru categorii de aliaje de lipire: - Alam\u0103 de uz general - Alam\u0103 cu con\u021Binut de argint \u0219i nichel - Alam\u0103 de \xEEnalt\u0103 temperatur\u0103 pentru aplica\u021Bii speciale. Aceste aliaje sunt economice \u0219i satisfac o gam\u0103 larg\u0103 de cerin\u021Be cu o gam\u0103 larg\u0103 de lipire, precum \u0219i posibilitatea de a umple spa\u021Bii deschise \xEEn piesele din cupru. Sudurile cu acest aliaj au rezisten\u021B\u0103 mare la rupere \u0219i trac\u021Biune."},{table:!0,id:4,title:"Aliaje de lipit cu continut de Aluminiu si Magneziu",category:"Aliaje",imageURL:"image4.jpg",descriere:"Aliaje pe baz\u0103 de aluminiu \u0219i magneziu pentru sudare folosind MIG/TIG. Acestea sunt folosite pentru lipirea aliajelor de aluminiu \u0219i magneziu."},{table:!0,id:5,title:"Aliaje de lipit cu continut de Cupru Sudura MIG - TIG",category:"Aliaje",imageURL:"image5.jpg",descriere:"Aliaje pe baz\u0103 de cupru pentru sudur\u0103, utiliz\xE2nd MIG/TIG."},{table:!0,id:6,title:"Aliaje de lipit cu continut de Staniu, Plumb si Argint",category:"Aliaje",imageURL:"image6.jpg",descriere:"Aliaje care con\u021Bin cadmiu \u0219i plumb sunt supuse unor anumite norme de protec\u021Bie \u0219i siguran\u021B\u0103 \xEEn timpul folosirii pentru evitarea intoxica\u021Biei cu vapori de cadmiu \u0219i plumb."},{table:!0,id:7,title:"Aliaje cu continut de Fosfor",category:"Aliaje",imageURL:"image7.jpg",descriere:"Aceste aliaje de lipire sunt, \xEEn general, folosite atunci c\xE2nd este nevoie de o bun\u0103 rezisten\u021B\u0103 la coroziune \u0219i temperaturi ridicate. Sunt ideale pentru o\u021Beluri inoxidabile \u0219i aliaje pe baz\u0103 de nichel."},{table:!0,id:8,title:"Aliaje cu continut de Nichel",category:"Aliaje",imageURL:"image8.jpg",descriere:"Aceste aliaje de lipire sunt, \xEEn general, folosite atunci c\xE2nd este nevoie de o bun\u0103 rezisten\u021B\u0103 la coroziune \u0219i temperaturi ridicate. Sunt ideale pentru o\u021Beluri inoxidabile \u0219i aliaje pe baz\u0103 de nichel."},{table:!0,id:9,title:"Aliaje de sudura pentru Inox MIG - TIG",category:"Aliaje",imageURL:"image9.jpg",descriere:"S\xE2rma \u0219i vergele din o\u021Bel inoxidabil pentru sudur\u0103 TIG/MIG."},{table:!0,id:10,title:"Aliaje de sudura pentru otelurilor cu continut scazut de Carbon si slab aliate",category:"Aliaje",imageURL:"image10.jpg",descriere:""},{table:!0,id:13,title:"Aliaje antifrictiune",imageURL:"image11.jpg",descriere:"Aliajele antifrictiune pe baza de staniu sau plumb sunt considerate printre cele mai bune materiale pentru lagare, fiind caracterizate prin: temperatura scazuta de topire si proprietati bune de turnare, rezistenta ridicata la frecare si compresiune la presiune si viteze mari, stabilitate inalta la coroziune in diferite substante folosite pentru ungere, conductibilitate termica suficienta, aderenta corespunzatoare la peretii lagarului, rezistenta mare la uzura, precum si o usoara prelucrare prin aschiere. De asemenea poseda o mare plasticitate si o duritate suficienta pentru a asigura valori mici coeficientilor de frecare, avand o structura eterogena, alcatuita dintr-o baza moale (metal pur, solutie solida sau eutectic) in care se gasesc distribuiti uniform compusi intermetalici duri.",category:"Altele"},{table:!0,id:11,title:"Aliaje de lipit cu continut de Argint, indiu, nichel, staniu, zinc, trimetalice (Aplicatii Speciale)",category:"Aliaje",imageURL:"image12.jpg",descriere:"Aliaje de lipit pe baz\u0103 de argint pentru aplica\u021Bii speciale \u0219i pentru utilizarea \xEEn condi\u021Bii speciale. Acestea sunt caracterizate printr-o compozi\u021Bie chimic\u0103 datorit\u0103 ad\u0103ug\u0103rii de elemente specifice."},{table:!0,id:12,title:"Fluxuri",category:"Aliaje",imageURL:"image13.jpg",descriere:""},{table:!0,id:14,title:"Perii bachelit-grafit",category:"Perii",imageURL:"image14.jpg",descriere:"Periile bachelit-grafit asigura contactul pentru: Motoare electrice in curent alternativ cu colector, motoare in curent continuu pana la 30 KW, motoare de mare putere, motoare fractionare, motoare pentru scule de mana, motoare auxiliare de tractiune."},{table:!0,id:15,title:"Perii metal-grafit",category:"Perii",imageURL:"image15.jpg",descriere:"Periile executate din metal-grafit sunt recomandate pentru echiparea motoarelor de curent continuu cu inele, motoare de utilizare generala, motoare din siderurgie, industria auto."},{table:!0,id:16,title:"Perii electrografit",category:"Perii",imageURL:"image16.jpg",descriere:"Periile electrografitice sunt utilizate in general pentru motoare si generatoare de curent continuu, masini stationare pentru echipamente industriale, masini tehnologice utilizate in siderurgie, textile, industria celulozei si hartiei, prelucrarea cauciucului, servomotoare cu intrefier axial, motoare electrice universale. In tractiunea electrica, varietatile periilor electrice sunt folosite pentru echiparea masinilor electrice auxiliare pentru locomotive si pentru metrou, si pentru echiparea motoarelor de tractiune urbana (tranvaie si troleibuze)."},{table:!0,id:17,title:"Perii carbon dur",category:"Perii",imageURL:"image17.jpg",descriere:"Periile carbonice dure sunt folosite la motoarele electrice ale aparatelor gospod\u0103re\u0219ti, la distribuitoare de aprindere \u0219i magnetou, la ma\u0219ini electrice rotative cu sau f\u0103r\u0103 poli auxiliari"},{table:!0,id:18,title:"Perii grafit carbon",category:"Perii",imageURL:"image18.jpg",descriere:""},{table:!0,id:19,title:"Perii grafit",category:"Perii",imageURL:"image19.jpg",descriere:""},{table:!0,id:20,title:"Perii argint grafit",category:"Perii",imageURL:"image20.jpg",descriere:""},{table:!0,id:21,title:"Portperii",category:"Perii",imageURL:"image21.jpg",descriere:"      O parte foarte importanta a unui motor electric o reprezinta periile colectoare. Acestea sunt fixate in portperii. De foarte multe ori se intampla ca fixarea periilor in portperii sa fie necorespunzatoare. In aceste cazuri este indicat ca achizitionarea periilor sa se faca montate deja in portperii."},{table:!1,id:22,title:"Arcuri disc",category:"Arcuri",imageURL:"image22.jpg",descriere:"Arcurile disc sunt formate dintr-una sau mai multe placi elastice inelare, de forma tronconica, supuse la sarcini axiale de compresiune Avantajele arcurilor disc se refera, in principal, la: dimensiuni de gabarit reduse; preiau sarcini mari, la sageti relative mici; amortizeaza socurile si vibratiile; rigiditatea poate fi modificata atat prin dimensiunile discurilor cat si prin modul de asezare a acestora; prezinta siguranta in exploatare (deteriorarea unui disc nu scoate arcul din uz, ci schimba doar caracteristica) Arcurile disc se utilizeaza ca arcuri tampon la instalatiile de matritat sau stantat, la fundatia masinilor grele, la tampoanele unor vehicule etc., acolo unde trebuiesc preluate socuri rare si mari sau sarcini statice foarte mari, cu deformatii relativ mici. Discurile se executa prin stantare, din tabla de otel de arc. Initial, au forma unor discuri plane, iar ulterior sunt bombate conic, prin presare la cald, si tratate termic"},{table:!1,id:23,title:"Arcuri de compresie",category:"Arcuri",imageURL:"image23.jpg",descriere:""},{table:!1,id:24,title:"Arcuri de tractiune",category:"Arcuri",imageURL:"image24.jpg",descriere:" Arcurile elicoidale de tractiune au o larga utilizare in constructia de masini si se executa din sarma sau bare de diferite sectiuni, infasurate dupa o elice, pe o anumita suprafata directoare La arcurile elicoidale de tractiune, sarcina se aplica prin intermediul ochiurilor de prindere, de forma unor carlige sau prin intermediul unor piese separate Teoretic, arcurile elicoidale de tractiune au caracteristica elastica identica cu cea a arcurilor de compresiune. Aceste arcuri se infasoara strans. Ca urmare, spirele nu numai ca sunt in contact, ci uneori se si apasa reciproc, datorita unei forte initiale de pretensionare care pentru a incepe deformarea elastica a arcului trebuie depasita de forta exterioara"},{table:!1,id:25,title:"Arcuri de torsiune",category:"Arcuri",imageURL:"image25.jpg",descriere:"Arcurile elicoidale de torsiune difera ca forma de arcurile elicoidale cilindrice de tractiune-compresiune doar prin spirele de capat, care sunt astfel construite incat permit incarcarea arcului cu momente de torsiune Deoarece spirele sunt solicitate in principal la incovoiere, arcurile elicoidale de torsiune se mai numesc si arcuri flexionale. La aplicarea unui moment de torsiune, spirele au tendinta de a-si micsora diametrul de infasurare. Aceste arcuri sunt intalnite la mecanismele de zavorare, la unele tipuri de cuplaje etc."},{table:!1,id:26,title:"Arcuri cu dubla torsiune",category:"Arcuri",imageURL:"image26.jpg",descriere:""},{table:!1,id:27,title:"Arcuri volute",category:"Arcuri",imageURL:"image27.jpg",descriere:""},{table:!1,id:28,title:"Arcuri lamelare",category:"Arcuri",imageURL:"image28.jpg",descriere:""},{table:!1,id:29,title:"Arcuri pentru portperii",category:"Arcuri",imageURL:"image29.jpg",descriere:""},{table:!1,id:30,title:"Diverse arcuri",category:"Arcuri",imageURL:"image30.jpg",descriere:""},{table:!1,id:31,title:"MICA NATURALA",category:"Materiale",imageURL:"image31.jpg",descriere:"Mica este un mineral din grupa silicatilor cu un sistem de cristalizare monoclinic, cu o structura chimica complexa, care se substituie frecvent dar raman in raport constant cu ceilalti atomi. Mica are o duritate redusa 2, paralel cu planurile de suprafata a mineralului, pe cand in alte directii duritatea este 4. Culoarea mineralului este variata, alb, roz, verde, brun, pana la negru, urma fiind alba. Mica este un silicat stratificat, a caror structura tetraedrica format din siliciu si oxigen sunt situati pe straturi caracteristice tabulare, intre straturi fiind legaturi slabe, din care cauza se desprind usor in foite elastice hexagonale, sub forma de agregate solzoase. Datorita clivajului bun de-a lungul foilor de mica, mica se poate desface in foite subtiri transparente, datorita rezistentei la temperaturi mari, foile de mica sunt folosite ca inlocuitor de sticla la vizorul cuptoarelor din topitorii metalurgice. Placile din mica naturala sunt folosite ca izolator electric, la semiconductori, condensatoare, cabluri coaxiale, electrozi, instalatii de brazare etc, mica rezista la temperaturi de peste 600 \xB0C."},{table:!0,id:32,title:"DELBOND M 100 HD 54300",category:"Materiale",imageURL:"image32.jpg",descriere:"HTML"},{table:!0,id:33,title:"DELBOND M 100 HD 54310",category:"Materiale",imageURL:"image33.jpg",descriere:"HTML"},{table:!0,id:34,title:"DELBOND M 100 HD 54380",category:"Materiale",imageURL:"image34.jpg",descriere:"HTML"},{table:!0,id:35,title:"DELBOND M 100 54500",category:"Materiale",imageURL:"image35.jpg",descriere:"HTML"},{table:!0,id:36,title:"DELBOND BM 200 54920",category:"Materiale",imageURL:"image36.jpg",descriere:"HTML"},{table:!0,id:37,title:"DELBOND M 200 HD 54220",category:"Materiale",imageURL:"image37.jpg",descriere:"HTML"},{table:!0,id:38,title:"GLASOFLEX 251.42-01",category:"Materiale",imageURL:"image38.jpg",descriere:"HTML"},{table:!0,id:39,title:"GLASOFLEX 251.42 (DELBOND 54240)",category:"Materiale",imageURL:"image39.jpg",descriere:"HTML"},{table:!0,id:41,title:"Calmica Flex",category:"Materiale",imageURL:"no-image.jpg",descriere:"HTML"},{table:!0,id:47,title:"Benzi calibrate din otel inox pentru by-lagare",category:"Benzi",imageURL:"no-image.jpg",descriere:"Tolerante dimensionale conform   norme DIN EN ISO 9445-2: 2010-06 sau conform cerinta client"},{table:!0,id:49,title:"Benzi calibrate din otel inox pentru arcuri",category:"Benzi",imageURL:"no-image.jpg",descriere:"HTML"},{table:!0,id:50,title:"Benzi din otel nealiat laminate la rece",category:"Benzi",imageURL:"no-image.jpg",descriere:"Tolerante dimensionale conform  norme DIN EN 10140:2006-09 "},{table:!0,id:51,title:"Benzi din otel nedurificat pentru arcuri",category:"Benzi",imageURL:"no-image.jpg",descriere:"HTML"},{table:!0,id:52,title:"Benzi din otel durificat pentru arcuri",category:"Benzi",imageURL:"no-image.jpg",descriere:"HTML"},{table:!0,id:53,title:"Benzi si placi din grafit",category:"Altele",imageURL:"image40.jpg",descriere:"HTML"},{table:!1,id:54,title:"Sarma din alama",category:"Sarma",imageURL:"no-image.jpg",descriere:""},{table:!1,id:55,title:"Sarma din otel din aliaj de carbon",category:"Sarma",imageURL:"no-image.jpg",descriere:"WintWire is not limited to any carbon alloy grade, using its vast network of well-established suppliers WintWire can offer most carbon alloy grades. Below is a list of more regularly stocked grades which have a short lead time. Other grades are available upon request. Simply request a quotation."},{table:!1,id:56,title:"Sarma din otel carbon",category:"Sarma",imageURL:"no-image.jpg",descriere:"WintWire manufactures a range of mild steel wires, not limited to the list below. Materials in this section can be coated, this includes: copper coating, copper wash, galvanising, bright drawing, soap drawing or bright polished finish. The following grades are available in one of the four temper conditions detailed below."},{table:!0,id:57,title:"Sarma din cupru",category:"Sarma",imageURL:"no-image.jpg",descriere:""},{table:!0,id:58,title:"Sarma din otel usoar",category:"Sarma",imageURL:"no-image.jpg",descriere:""},{table:!0,id:59,title:"Sarma din aliaje de nichel",category:"Sarma",imageURL:"no-image.jpg",descriere:""},{table:!0,id:60,title:"Sarma din nichel si argint",category:"Sarma",imageURL:"no-image.jpg",descriere:""},{table:!0,id:61,title:"Sarma din fosfor si bronz",category:"Sarma",imageURL:"no-image.jpg",descriere:""},{table:!0,id:62,title:"Sarma de arc",category:"Sarma",imageURL:"no-image.jpg",descriere:""},{table:!0,id:63,title:"Sarma din otel inoxidabil",category:"Sarma",imageURL:"no-image.jpg",descriere:""},{table:!0,id:64,title:"Sarma din titan grad 5",category:"Sarma",imageURL:"no-image.jpg",descriere:""},{table:!0,id:65,title:"Sarma din aliaje diverse",category:"Sarma",imageURL:"no-image.jpg",descriere:""},{table:!0,id:66,title:"Cuplaje si frane electromagnetice",imageURL:"cuplaje.jpg",descriere:"Cuplajele sunt organe de masini sau sisteme echivalente acestora si realizeaza legatura dintre doua elemente consecutive ale unui lant cinematic, in scopul transmiterii momentului de torsiune si a miscarii de rotatie. La cuplajele si franele electromagnetice, functionarea este asigurata ca urmare a fortei creata de un camp electromagnetic. Cuplajul realizeaza transmiterea unui moment de torsiune intre partea care antreneaza si partea antrenata. Frana realizeaza anularea sau diminuarea miscarii de rotatie, generand un moment de franare.",category:"Altele"},{table:!0,id:67,title:"Produse din plumb",imageURL:"produse-plumb.jpg",descriere:"Plumbul este un metal greu, de culoare gri-argintie cu densitatea foarte mare. Datorita densitatii ridicate, plumbul si-a gasit utilizarea la protectia contra radiatiei ionizante. De asemenea, plumbul este folosit la fabricarea de greutati mici dar cu mase mari. Acest metal este toxic pentru organismul uman, intoxicatia numindu-se saturnism. De asemenea, plumbul se utilizeaza la fabricarea acumulatorilor pentru autoturisme. Datorita punctului de fuziune scazut, plumbul se utilizeaza la bai cu metale topite in laborator si la fabricarea aliajelor de lipit in electrotehnica (aliaje staniu-plumb).",subtitle:" Tabla, sarma, platbanda, lingouri",category:"Altele"},{table:!0,id:68,title:"Lagare, segmenti, inele de etansare si bucse din grafit",imageURL:"no-image.jpg",descriere:"HTML",category:"Altele"}];getSubcategories(){return this.subcategoriesObject}getTitles(){return this.subcategoriesObject.map(e=>({table:!0,id:e.id,title:e.title}))}findTitles(e){let a=e==="HTML"?"":e.toLowerCase();return this.subcategoriesObject.filter(i=>i.title.toLowerCase().includes(a)||i.descriere.toLowerCase().includes(a)).map(i=>({table:!0,id:i.id,title:i.title}))}static \u0275fac=function(a){return new(a||r)};static \u0275prov=t({token:r,factory:r.\u0275fac,providedIn:"root"})};export{l as a};
